(1312, 'created', 6, 'App\\Page', 1, '{\"id\":\"6\",\"title\":\"Politique de confidentialit\\u00e9\",\"slug\":\"politique-de-confidentialit\\u00e9\",\"description\":\"&lt;p&gt;Voucher Wing souhaite conserver vos informations personnelles en toute s\\u00e9curit\\u00e9 et en toute confidentialit\\u00e9. Nous attendons \\u00e9galement la m\\u00eame chose de nos clients. Veuillez lire les politiques de confidentialit\\u00e9 suivantes pour comprendre le m\\u00e9canisme de confidentialit\\u00e9 et de confidentialit\\u00e9 que Voucher Wing maintient avec les informations que vous nous avez fournies.&lt;\\/p&gt;&lt;p&gt;La politique de confidentialit\\u00e9 est sujette \\u00e0 changement par rapport \\u00e0 la d\\u00e9cision de l\'entreprise. Pour rester \\u00e0 jour, continuez de visiter notre page Web officielle.&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Renseignements personnels&lt;\\/p&gt;&lt;p&gt;Notre \\u00e9quipe extrait uniquement votre adresse e-mail, votre sexe et votre \\u00e2ge lorsque vous vous inscrivez sur notre site Web. L\'utilisateur enregistr\\u00e9 ne re\\u00e7oit qu\'une promotion occasionnelle de son int\\u00e9r\\u00eat par courrier \\u00e9lectronique. L\\u2019adresse \\u00e9lectronique n\\u2019est ni partag\\u00e9e ni vendue \\u00e0 des agents de commercialisation ou des agences tiers.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Donn\\u00e9es rassembl\\u00e9es&lt;\\/p&gt;&lt;p&gt;Les informations collect\\u00e9es, telles que la page visit\\u00e9e par un utilisateur ou l\'acc\\u00e8s, et tout ce que ses utilisateurs offrent, sont conserv\\u00e9es en toute s\\u00e9curit\\u00e9 avec nous. Dans la mesure o\\u00f9 Voucher Wing reconna\\u00eet et enregistre les adresses IP lorsqu\'un utilisateur se connecte, il est important que l\'utilisateur sache qu\'il reste sous la confidentialit\\u00e9 totale de notre \\u00e9quipe. Lorsqu\'un utilisateur essaie de se connecter sur n\'importe quelle page de Voucher Wing, son adresse IP est enregistr\\u00e9e sur notre serveur, qui sert uniquement \\u00e0 des fins d\'analyse du trafic Web.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Utilisation de cookies&lt;\\/p&gt;&lt;p&gt;Voucher Wing utilise des cookies uniquement \\u00e0 des fins de conservation des donn\\u00e9es et pour am\\u00e9liorer encore l\'exp\\u00e9rience de l\'utilisateur en m\\u00e9morisant les mots de passe et en mesurant les activit\\u00e9s sur notre site web.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Abonnements et alertes de coupons&lt;\\/p&gt;&lt;p&gt;Voucher Wing envoie des lettres d\'information et des alertes de coupons uniquement aux utilisateurs enregistr\\u00e9s. La lettre d\'information contient des informations telles que les nouvelles offres, les changements de politique ou toute autre nouvelle importante, car nous souhaitons tenir nos utilisateurs inform\\u00e9s. Les alertes de coupon ou de remise peuvent varier d\\u2019un utilisateur \\u00e0 l\\u2019autre, car nous recueillons les donn\\u00e9es selon les pr\\u00e9f\\u00e9rences de l\\u2019utilisateur, individuellement. Ces types d\\u2019e-mails p\\u00e9riodiques contiennent de nouveaux codes de coupon, offres et promotions des marques qu\\u2019un utilisateur ach\\u00e8te et pr\\u00e9f\\u00e8re.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Association \\u00e0 d\'autres sites Web&lt;\\/p&gt;&lt;p&gt;Nous avons des liens vers d\'autres sites Web et qui ne suivent peut-\\u00eatre pas la m\\u00eame politique que Voucher Wing. Nous sommes responsables de la confidentialit\\u00e9 des utilisateurs de Voucher Wing.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;Voucherwing Inc,&lt;\\/b&gt;&lt;\\/p&gt;&lt;p&gt;2718 Highland View Drive&lt;\\/p&gt;&lt;p&gt;Roseville, CA 95678 United States&lt;\\/p&gt;&lt;p&gt;Propri\\u00e9taire d\'entreprise: James Wilson&lt;\\/p&gt;&lt;p&gt;T\\u00e9l\\u00e9phone : +1 916-640-2337&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;E-mail du propri\\u00e9taire: voucherswing@gmail.com&lt;\\/p&gt;\",\"publish\":\"1\",\"meta_title\":\"Politique de confidentialit\\u00e9 | Voucherwing\",\"meta_keywords\":\"Politique de confidentialit\\u00e9\",\"meta_description\":\"Politique de confidentialit\\u00e9\",\"updated_at\":\"2020-01-17 12:28:52\",\"created_at\":\"2020-01-17 12:28:52\",\"image\":null,\"banner_image\":null,\"additional_image\":null,\"media\":[]}', '127.0.0.1', '2020-01-17 07:28:52', '2020-01-17 07:28:52'),
