tion sur le site sont obligatoires.&lt;\\/p&gt;&lt;p&gt;Le site fournit \\u00e0 l\'utilisateur une collecte et un traitement d\'informations personnelles dans le respect de la vie priv\\u00e9e, conform\\u00e9ment \\u00e0 la loi n \\u00b0 78-17 du 6 janvier 1978 relative \\u00e0 l\'informatique, aux fichiers et aux libert\\u00e9s.&lt;\\/p&gt;&lt;p&gt;En vertu des articles 39 et 40 de la loi du 6 janvier 1978, l\'utilisateur dispose d\'un droit d\'acc\\u00e8s, de rectification, de suppression et d\'opposition concernant ses donn\\u00e9es personnelles en envoyant un courrier \\u00e9lectronique \\u00e0 l\'adresse voucherswing@gmail.com. Codepromo.voucherwing.com se r\\u00e9serve le droit de refuser toute inscription ou de supprimer un compte \\u00e0 tout moment sans donner la raison.&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;Biscuit&lt;\\/b&gt;&lt;\\/p&gt;&lt;p&gt;Le site utilise des cookies Codepromo.voucherwing.com. Un cookie est un petit fichier texte stock\\u00e9 dans le navigateur de l\'utilisateur et lui permettant de stocker des informations entre les pages qu\'il visite et son navigateur. Codepromo.voucherwing.com utilise des cookies produits et utilis\\u00e9s par Codepromo.voucherwing.com ainsi que des &quot;cookies externes&quot; g\\u00e9n\\u00e9r\\u00e9s sur son site web par des tiers. Ils permettent de m\\u00e9moriser l\'historique des visites de l\'utilisateur sur le site Web, d\'enregistrer les donn\\u00e9es du client et d\'afficher le contenu appropri\\u00e9 en fonction des choix et des visites. Cela aide \\u00e9galement Codepromo.voucherwing.com \\u00e0 comprendre le comportement de l\'utilisateur sur son site Web, am\\u00e9liorant ainsi son exp\\u00e9rience de navigation. Les cookies ne peuvent pas stocker de texte et sont toujours anonymes et crypt\\u00e9s.&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;D\\u00e9sactiver et supprimer les cookies&lt;\\/b&gt;&lt;\\/p&gt;&lt;p&gt;Tous les navigateurs Internet permettent \\u00e0 l\'utilisateur de limiter le comportement d\'un cookie ou de le d\\u00e9sactiver en acc\\u00e9dant \\u00e0 la section param\\u00e8tres ou options de son navigateur. Les \\u00e9tapes de d\\u00e9sactivation des cookies sont sp\\u00e9cifiques \\u00e0 chaque navigateur, l\'utilisateur peut les trouver dans la section Aide de son navigateur. Gr\\u00e2ce au navigateur, l\'utilisateur peut \\u00e9galement afficher les cookies qui se trouvent sur son ordinateur et les supprimer \\u00e0 sa guise. Les cookies sont des fichiers texte, l\'utilisateur peut ouvrir et lire leur contenu. Les donn\\u00e9es contenues sont g\\u00e9n\\u00e9ralement crypt\\u00e9es avec une cl\\u00e9 num\\u00e9rique correspondant \\u00e0 une session Internet. Si l\'utilisateur d\\u00e9sactive les cookies, le site Web Codepromo.voucherwing.com n\'est pas en mesure d\'enregistrer ses informations de connexion sur son site. Codepromo.voucherwing.com collabore \\u00e9galement avec des partenaires pour cr\\u00e9er des cookies tiers, qui sont ensuite utilis\\u00e9s sur d\'autres sites pour diffuser des publicit\\u00e9s pertinentes sur les banni\\u00e8res fournies \\u00e0 cette fin. Ces cookies ne contiennent aucune information personnelle, ils n\'identifient pas d\'autres sites et sont bas\\u00e9s uniquement sur l\'historique de navigation de l\'utilisateur. Tous les coupons identifi\\u00e9s comme &quot;EXCLUSIFS&quot; ne peuvent \\u00eatre republi\\u00e9s sur aucune autre plate-forme sans le consentement expr\\u00e8s de Codepromo.voucherwing.com. Toutes les offres sont choisies par l\'\\u00e9quipe de Codepromo.voucherwing.com et sont valables \\u00e0 partir de la date de publication. Ces cookies ne contiennent aucune information personnelle, ils n\'identifient pas d\'autres sites et sont bas\\u00e9s uniquement sur l\'historique de navigation de l\'utilisateur. Tous les coupons identifi\\u00e9s comme &quot;EXCLUSIVE&quot; ne peuvent \\u00eatre republi\\u00e9s sur aucune autre plate-forme sans le consentement expr\\u00e8s de Codepromo.voucherwing.com. Toutes les offres