(1314, 'created', 10, 'App\\Page', 1, '{\"id\":\"10\",\"title\":\"\\u00c0 propos de nous\",\"slug\":\"a-propos-de-nous\",\"description\":\"&lt;p&gt;Voucher Wing est l\'un des principaux sites de coupons d\'\\u00e9pargne qui influence positivement les d\\u00e9cisions d\'achat des achats en ligne. Voucher Wing a des partenaires connect\\u00e9s du monde entier engag\\u00e9s dans l\'achat et la vente, tous ensemble. Il sert plus de 50 000 marques \\u00e0 l\'\\u00e9chelle internationale. Nous traitons des offres de rabais, des cartes-cadeaux, des codes de bon de r\\u00e9duction et d\'autres offres promotionnelles pour l\'ann\\u00e9e.&lt;\\/p&gt;&lt;p&gt;Nous nous assurons de vous doter de services d\'assistance \\u00e0 la client\\u00e8le incroyables afin de cr\\u00e9er une plate-forme en ligne simple et confortable pour vos achats. Il vous permet de b\\u00e9n\\u00e9ficier de remises exceptionnelles pour l\\u2019ann\\u00e9e, associ\\u00e9es \\u00e0 une grande vari\\u00e9t\\u00e9 de marques. Nous aidons toutes ces marques \\u00e0 atteindre leurs objectifs en combinant leurs mains avec nous.&lt;\\/p&gt;&lt;p&gt;Nos principes&lt;\\/p&gt;&lt;p&gt;Haute int\\u00e9grit\\u00e9&lt;\\/p&gt;&lt;p&gt;Plus grande accessibilit\\u00e9&lt;\\/p&gt;&lt;p&gt;Plus grande fiabilit\\u00e9&lt;\\/p&gt;&lt;p&gt;Maintenir la confidentialit\\u00e9&lt;\\/p&gt;&lt;p&gt;Cr\\u00e9er de la pertinence&lt;\\/p&gt;&lt;p&gt;Offrant la vari\\u00e9t\\u00e9&lt;\\/p&gt;\",\"publish\":\"1\",\"meta_title\":\"\\u00c0 propos de nous | Voucherwing\",\"meta_keywords\":\"\\u00c0 propos de nous\",\"meta_description\":\"\\u00c0 propos de nous\",\"updated_at\":\"2020-01-17 12:28:54\",\"created_at\":\"2020-01-17 12:28:54\",\"image\":null,\"banner_image\":null,\"additional_image\":null,\"media\":[]}', '127.0.0.1', '2020-01-17 07:28:54', '2020-01-17 07:28:54'),
