(1416, 'created', 3, 'App\\Page', 1, '{\"id\":\"3\",\"title\":\"\\u00dcber uns\",\"slug\":\"uber-uns\",\"description\":\"&lt;p&gt;Voucher Wing ist eine der f\\u00fchrenden Sites f\\u00fcr Spargutscheine, die die Kaufentscheidungen beim Online-Einkauf positiv beeinflussen. Voucher Wing hat Partner aus der ganzen Welt zusammengebracht, die gemeinsam kaufen und verkaufen. Es bedient mehr als 50.000 Marken international. Wir handeln mit Rabattangeboten, Geschenkkarten, Gutscheincodes und anderen Sonderangeboten f\\u00fcr das Jahr.&lt;\\/p&gt;&lt;p&gt;Wir stellen sicher, dass Sie einen unglaublichen Kundenservice erhalten, um eine einfache und komfortable Online-Plattform f\\u00fcr Ihren Einkauf zu schaffen. Mit dieser App k\\u00f6nnen Sie das ganze Jahr \\u00fcber tolle Preisnachl\\u00e4sse f\\u00fcr eine Vielzahl von Marken genie\\u00dfen. Wir helfen all diesen Marken, ihre Ziele zu erreichen, indem wir uns zusammenschlie\\u00dfen.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Unsere Prinzipien&lt;\\/p&gt;&lt;p&gt;Hohe Integrit\\u00e4t&lt;\\/p&gt;&lt;p&gt;Bessere Zug\\u00e4nglichkeit&lt;\\/p&gt;&lt;p&gt;H\\u00f6here Zuverl\\u00e4ssigkeit&lt;\\/p&gt;&lt;p&gt;Vertraulichkeit wahren&lt;\\/p&gt;&lt;p&gt;Relevanz schaffen&lt;\\/p&gt;&lt;p&gt;Vielfalt bieten&lt;\\/p&gt;\",\"publish\":\"1\",\"meta_title\":\"\\u00dcber uns | Voucherwing\",\"meta_keywords\":\"\\u00dcber uns\",\"meta_description\":\"\\u00dcber uns\",\"updated_at\":\"2020-01-20 09:44:04\",\"created_at\":\"2020-01-20 09:44:04\",\"image\":null,\"banner_image\":null,\"additional_image\":null,\"media\":[]}', '127.0.0.1', '2020-01-20 04:44:04', '2020-01-20 04:44:04'),
(1417, 'created', 4, 'App\\Page', 1, '{\"id\":\"4\",\"title\":\"Impressum\",\"slug\":\"impressum\",\"description\":\"&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;Name des Herausgebers &lt;\\/b&gt;: Voucherwing Inc,&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;Gesch\\u00e4ftsinhaber&lt;\\/b&gt;: James Wilson&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;Adresse&lt;\\/b&gt;: 2718 Highland View Drive&lt;\\/p&gt;&lt;p&gt;Roseville, CA 95678 United States&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;Telefon &lt;\\/b&gt;: +1 916-640-2337&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;E-Mail des Eigent\\u00fcmers&lt;\\/b&gt;: voucherswing@gmail.com&lt;\\/p&gt;\",\"publish\":\"1\",\"meta_title\":\"Impressum | Voucherwing\",\"meta_keywords\":\"Impressum\",\"meta_description\":\"Impressum\",\"updated_at\":\"2020-01-20 09:44:04\",\"created_at\":\"2020-01-20 09:44:04\",\"image\":null,\"banner_image\":null,\"additional_image\":null,\"media\":[]}', '127.0.0.1', '2020-01-20 04:44:04', '2020-01-20 04:44:04');
