(1418, 'created', 7, 'App\\Page', 1, '{\"id\":\"7\",\"title\":\"Datenschutz\",\"slug\":\"datenschutz\",\"description\":\"&lt;p&gt;Voucher Wing ist bestrebt, Ihre pers\\u00f6nlichen Daten sicher und vertraulich zu behandeln. Das erwarten wir auch von unseren Kunden. Bitte lesen Sie die folgenden Datenschutzrichtlinien, um den Mechanismus der Vertraulichkeit und des Datenschutzes zu verstehen, den Voucher Wing mit Ihren uns zur Verf\\u00fcgung gestellten Informationen pflegt.&lt;\\/p&gt;&lt;p&gt;Die Datenschutzbestimmungen unterliegen \\u00c4nderungen in Bezug auf die Entscheidung des Unternehmens. Um auf dem Laufenden zu bleiben, besuchen Sie unsere offizielle Webseite.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Pers\\u00f6nliche Informationen&lt;\\/p&gt;&lt;p&gt;Unser Team extrahiert Ihre E-Mail-Adresse, Ihr Geschlecht und Ihr Alter nur, wenn Sie sich auf unserer Website anmelden. Der registrierte Benutzer wird nur gelegentlich per E-Mail \\u00fcber sein Interesse informiert. Die E-Mail-Adresse wird nicht an Drittanbieter oder Agenturen weitergegeben oder verkauft.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Gesammelte Daten&lt;\\/p&gt;&lt;p&gt;Die gesammelten Informationen, z. B. welche Seite ein Benutzer am h\\u00e4ufigsten besucht, oder der Zugriff und alles, was er freiwillig macht, werden sicher bei uns aufbewahrt. Da Voucher Wing IP-Adressen erkennt und speichert, wenn sich ein Benutzer anmeldet, ist es wichtig, dass der Benutzer wei\\u00df, dass diese von unserem Team streng vertraulich behandelt werden. Wenn ein Benutzer versucht, sich auf einer Voucher Wing-Seite anzumelden, wird seine IP auf unserem Server gespeichert, der nur zur Analyse des Webverkehrs verwendet wird.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Verwendung von Cookies&lt;\\/p&gt;&lt;p&gt;Voucher Wing verwendet Cookies nur, um Aufzeichnungen zu f\\u00fchren und die Benutzererfahrung durch Speichern der Passw\\u00f6rter und Messen der Aktivit\\u00e4ten auf unserer Website zu verbessern.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Abonnements und Gutscheinbenachrichtigungen&lt;\\/p&gt;&lt;p&gt;Voucher Wing sendet Newsletter und Gutscheinbenachrichtigungen nur an registrierte Benutzer. Der Newsletter enth\\u00e4lt Informationen wie neue Angebote, \\u00c4nderungen der Richtlinien oder andere wichtige Neuigkeiten, damit wir unsere Benutzer auf dem Laufenden halten k\\u00f6nnen. Coupon- oder Rabattbenachrichtigungen k\\u00f6nnen von Benutzer zu Benutzer unterschiedlich sein, da wir die Daten nach Wunsch des Benutzers einzeln erfassen. Diese Art von regelm\\u00e4\\u00dfigen E-Mails enth\\u00e4lt neue Gutscheincodes, Angebote und Werbeaktionen der Marken, die ein Benutzer normalerweise kauft und bevorzugt.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Verkn\\u00fcpfung mit anderen Websites&lt;\\/p&gt;&lt;p&gt;Wir haben Links zu anderen Websites, die m\\u00f6glicherweise nicht den Richtlinien von Voucher Wing entsprechen. Wir sind daf\\u00fcr verantwortlich, die Privatsph\\u00e4re der Voucher Wing-Benutzer zu wahren.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 28px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Voucherwing Inc,&lt;\\/span&gt;&lt;\\/p&gt;&lt;p style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 28px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2718 Highland View Drive&lt;\\/span&gt;&lt;\\/p&gt;&lt;p style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 28px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Roseville, CA 95678 United States&lt;\\/span&gt;&lt;\\/p&gt;&lt;p style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 28px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: inherit; vertical-align: baseline;&quot;&gt;Gesch\\u00e4ftsinhaber&lt;\\/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;: James Wilson&lt;\\/span&gt;&lt;\\/p&gt;&lt;p style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 28px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Telefon&lt;\\/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;\\/span&gt;&lt;\\/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;: +1 916-640-2337&lt;\\/span&gt;&lt;\\/p&gt;&lt;p style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 28px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 14px; line-height: inherit; font-family: inherit; vertical-align: baseline;&quot;&gt;E-Mail des Eigent\\u00fcmers&lt;\\/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;: voucherswing@gmail.com&lt;\\/span&gt;&lt;\\/p&gt;\",\"publish\":\"1\",\"meta_title\":\"Datenschutz | Voucherwing\",\"meta_keywords\":\"Datenschutz\",\"meta_description\":\"Datenschutz\",\"updated_at\":\"2020-01-20 09:44:05\",\"created_at\":\"2020-01-20 09:44:05\",\"image\":null,\"banner_image\":null,\"additional_image\":null,\"media\":[]}', '127.0.0.1', '2020-01-20 04:44:05', '2020-01-20 04:44:05'),
(1419, 'created', 8, 'App\\Page', 1, '{\"id\":\"8\",\"title\":\"Nutzungsbedingungen\",\"slug\":\"nutzungsbedingungen\",\"description\":\"&lt;p&gt;&lt;b&gt;NUTZUNGSBEDINGUNGEN&lt;\\/b&gt;&lt;\\/p&gt;&lt;p&gt;Bitte lesen Sie die folgenden Nutzungsbedingungen sorgf\\u00e4ltig durch, da diese f\\u00fcr die Nutzung von gutscheine.voucherwing.com gelten, insbesondere wenn Sie einen Gutscheincode oder ein bestimmtes Produktangebot verwenden (sogenanntes Angebot).&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;DEFINITIONEN&lt;\\/b&gt;&lt;\\/p&gt;&lt;p&gt;H\\u00e4ndler: Dies sind alle Verk\\u00e4ufer, die die Website gutscheine.voucherwing.com nutzen, um Waren anzubieten.&lt;\\/p&gt;&lt;p&gt;Website: Dies bedeutet immer gutscheine.voucherwing.com bzw. Apps und Unterseiten.&lt;\\/p&gt;&lt;p&gt;Benutzer: Dies bedeutet, wer die Website oder deren Angebote nutzt.&lt;\\/p&gt;&lt;p&gt;Service: Dies bedeutet die Nutzung der Website und ihrer Funktionen.&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;GENERELL&lt;\\/b&gt;&lt;\\/p&gt;&lt;p&gt;Die Nutzung dieser Website ist ausschlie\\u00dflich f\\u00fcr Nutzer aus Deutschland bestimmt. Neben diesen Nutzungsbedingungen gelten f\\u00fcr die Angebote der H\\u00e4ndler (Gutscheine oder Angebote) die Vertragsbedingungen des jeweiligen H\\u00e4ndlers, die der Nutzer bei Vertragsabschluss mit dem H\\u00e4ndler ausdr\\u00fccklich anerkennt.&lt;\\/p&gt;&lt;p&gt;In Bezug auf die Angebote der H\\u00e4ndler auf unserer Website beschr\\u00e4nken sich unsere Dienstleistungen auf die Zuordnung von Nutzern und H\\u00e4ndlern zu einem H\\u00e4ndlercoupon oder -gesch\\u00e4ft.&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Bei den Leistungen der H\\u00e4ndler treten wir ausschlie\\u00dflich als Vermittler und nicht als Vertragspartner des Nutzers auf. Infolgedessen sind wir, unsere Mitarbeiter und Mitarbeiter in keiner Weise f\\u00fcr die vertragliche Erf\\u00fcllung solcher Vertr\\u00e4ge verantwortlich. Die Erf\\u00fcllung dieser Vertr\\u00e4ge liegt in der alleinigen Verantwortung der H\\u00e4ndler und Nutzer.&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Die Angebote auf der Website sind nur f\\u00fcr den nicht kommerziellen und privaten Gebrauch bestimmt. Eine von diesen Nutzungsbedingungen abweichende oder gegen diese Nutzungsbedingungen versto\\u00dfende Nutzung unserer Dienste ist nicht gestattet. Insbesondere liegt eine missbr\\u00e4uchliche Verwendung vor, wenn Sie vervielf\\u00e4ltigen, kopieren, gegen Entgelt Dritten zug\\u00e4nglich machen oder unentgeltlich \\u00c4nderungen vornehmen oder in sonstiger Weise in unseren Service eingreifen. Versto\\u00dfen Sie dagegen, k\\u00f6nnen wir Sie vor\\u00fcbergehend oder dauerhaft von der Nutzung des Dienstes ausschlie\\u00dfen und ggf. Schadensersatzanspr\\u00fcche gegen Sie geltend machen.&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;BEREITSTELLUNG UNSERER DIENSTLEISTUNGEN&lt;\\/b&gt;&lt;\\/p&gt;&lt;p&gt;Die Nutzung der Website und ihrer Funktionen (nachfolgend unser Service oder der Service) ist f\\u00fcr Sie kostenfrei. Wir arbeiten st\\u00e4ndig an Innovationen, um den Service noch besser zu machen - zum Beispiel durch Hinzuf\\u00fcgen oder Entfernen von Features oder Features.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Wir k\\u00f6nnen die Form und die Art unserer Dienstleistungen jederzeit und ohne vorherige Ank\\u00fcndigung \\u00e4ndern. Dies kann die Einstellung einzelner Dienste oder des gesamten Angebots umfassen. Nat\\u00fcrlich k\\u00f6nnen Sie den Dienst auch jederzeit k\\u00fcndigen. Hierf\\u00fcr ist keine K\\u00fcndigung oder Nachricht an uns erforderlich. Es reicht aus, dass Sie den Dienst nicht mehr nutzen.&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;ES IST VERBOTEN:&lt;\\/b&gt;&lt;\\/p&gt;&lt;p&gt;\\u2022 Um den Inhalt dieser Website zu reproduzieren. Vor allem auf anderen Websites.&lt;\\/p&gt;&lt;p&gt;\\u2022 Anst\\u00f6\\u00dfige oder unangemessene Inhalte hochladen oder verbreiten.&lt;\\/p&gt;&lt;p&gt;\\u2022 Laden Sie Inhalte hoch, f\\u00fcr die Sie keine Rechte haben.&lt;\\/p&gt;&lt;p&gt;\\u2022 Software oder Programme. Insbesondere Programme oder Software, die der Website Schaden zuf\\u00fcgen k\\u00f6nnten.&lt;\\/p&gt;&lt;p&gt;\\u2022 Teilen Sie Inhalte von anderen Benutzern ohne deren Erlaubnis.&lt;\\/p&gt;&lt;p&gt;\\u2022 Gesetze des Landes Deutschland nicht beachten.&lt;\\/p&gt;&lt;p&gt;\\u2022 Missachten Sie die in diesen Nutzungsbedingungen aufgef\\u00fchrten Punkte.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;NUTZUNG DIESER SEITE UND IHRER ANGEBOTE&lt;\\/b&gt;&lt;\\/p&gt;&lt;p&gt;Wir garantieren zu keinem Zeitpunkt die Richtigkeit der Angebote und die fehlerfreie Nutzung unseres Angebots. Selbstverst\\u00e4ndlich bem\\u00fchen wir uns, die Website fehlerfrei zu halten und eventuelle Fehler auszuschlie\\u00dfen.&lt;\\/p&gt;&lt;p&gt;&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Wir garantieren keinen einfachen Zugang zu unserer Website. Der Zugang zu unserer Website kann jederzeit unterbrochen werden.&lt;\\/p&gt;&lt;p&gt;Wir behalten uns das Recht vor, Angebote (zB Gutscheine und Angebote) ohne vorherige Ank\\u00fcndigung zu l\\u00f6schen.&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;VERRIEGELUNG EINES BENUTZERS&lt;\\/b&gt;&lt;\\/p&gt;&lt;p&gt;Wir behalten uns das Recht vor, Benutzer ohne Angabe von Gr\\u00fcnden von der Nutzung unserer Website auszuschlie\\u00dfen.&lt;\\/p&gt;&lt;p&gt;&lt;b&gt;HAFTUNGSBESCHR\\u00c4NKUNG&lt;\\/b&gt;&lt;\\/p&gt;&lt;p&gt;Wir \\u00fcbernehmen keine Haftung daf\\u00fcr, dass die Angebote der H\\u00e4ndler richtig dargestellt werden oder noch vorhanden sind, da wir hierauf keinen Einfluss haben. Benutzer sollten sich immer wieder mit dem H\\u00e4ndler in Verbindung setzen, wenn das Angebot wirklich besteht. Nach den gesetzlichen Bestimmungen der \\u00a7\\u00a7 8 bis 10 TMG sind wir als Diensteanbieter jedoch nicht verpflichtet, \\u00fcbermittelte oder ver\\u00f6ffentlichte fremde Informationen zu \\u00fcberwachen oder nach Umst\\u00e4nden zu forschen, die auf eine rechtswidrige T\\u00e4tigkeit hinweisen auf rechtswidrige Handlungen hinweisen.&lt;\\/p&gt;&