geerhebung nicht bekannt ist.&lt;\\/p&gt;&lt;p&gt;F\\u00fcr die von uns aufgrund dieser Nutzungsbedingungen geschlossenen Nutzungsbedingungen und f\\u00fcr etwaige nachtr\\u00e4gliche Anspr\\u00fcche jeglicher Art gilt ausschlie\\u00dflich das Recht der Bundesrepublik Deutschland unter Ausschluss des UN-Kaufrechts und des deutschen internationalen Privatrechts.&lt;br&gt;&lt;\\/p&gt;&lt;p&gt;Sollten Bestimmungen dieser Nutzungsbedingungen ganz oder teilweise unwirksam sein oder werden, so bleiben die \\u00fcbrigen Bestimmungen hiervon unber\\u00fchrt.&lt;br&gt;&lt;\\/p&gt;\",\"publish\":\"1\",\"meta_title\":\"Nutzungsbedingungen | Voucherwing\",\"meta_keywords\":\"Nutzungsbedingungen\",\"meta_description\":\"Nutzungsbedingungen\",\"updated_at\":\"2020-01-20 09:44:06\",\"created_at\":\"2020-01-20 09:44:06\",\"image\":null,\"banner_image\":null,\"additional_image\":null,\"media\":[]}', '127.0.0.1', '2020-01-20 04:44:06', '2020-01-20 04:44:06'),
