(1, 'Privacy Policy', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:15.0pt;line-height:33.0pt;mso-outline-level:\r\n2;background:#FAFAFA&quot;&gt;&lt;span style=&quot;background-color: rgb(255, 255, 255); font-size: 12pt; line-height: 200%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;Voucher\r\nWing &lt;/span&gt;&lt;span style=&quot;background-color: rgb(255, 255, 255); font-size: 12pt; line-height: 200%; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(51, 51, 51);&quot;&gt;is keen to retain your\r\npersonal information safely and with confidentiality. We also expect the same\r\nfrom our customers. Kindly read&amp;nbsp;the following privacy policies to\r\nunderstand the mechanism of confidentiality and privacy that &lt;/span&gt;&lt;span style=&quot;background-color: rgb(255, 255, 255); font-size: 12pt; line-height: 200%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;Voucher\r\nWing &lt;/span&gt;&lt;span style=&quot;background-color: rgb(255, 255, 255); font-size: 12pt; line-height: 200%; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(51, 51, 51);&quot;&gt;maintains with your\r\ninformation provided to us.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 15pt; line-height: 200%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;The privacy policy is\r\nsubjected to change with respect to the decision of the company. To stay\r\nupdated keep visiting our official web page.&amp;nbsp;\r\n&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 15pt; line-height: 200%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;Personal Information&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 15pt; line-height: 200%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;Our team only extract\r\nyour email address, gender and age while you sign up at our website. The\r\nregistered user only gets&amp;nbsp;occasional promotion of its interest through\r\nemails. Email address is not shared nor sold to any third-party marketers or\r\nagencies.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 15pt; line-height: 200%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;Gathered Data &lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 15pt; line-height: 200%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;The gathered\r\ninformation, such as which page a user mostly visits, or access and anything\r\nthat they volunteer is kept safely with us. As &lt;/span&gt;&lt;span style=&quot;font-size:\r\n12.0pt;line-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;Voucher Wing &lt;/span&gt;&lt;span style=&quot;font-size:12.0pt;line-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;recognizes and saves\r\nIP addresses when a user signs in, it’s important for the user to know that it\r\nstays under complete confidentiality of our team. When a user tries to log on\r\nany page of &lt;/span&gt;&lt;span style=&quot;font-size:12.0pt;line-height:200%;font-family:\r\n&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;Voucher Wing&lt;/span&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;, their IP is saved on our server which is\r\nonly used for the sake of web traffic analysis.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=