0pt;line-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;Voucher\r\nWing &lt;/span&gt;&lt;span style=&quot;font-size:12.0pt;line-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;sends newsletters and\r\ncoupon alerts to the registered users only. The newsletter contains&amp;nbsp;the\r\ninformation such as new offers, changes in policy or any other major news as we\r\nlike to keep our&amp;nbsp;users updated. Coupon or discount alerts may vary from\r\nuser to user, as we collect the data to a user’s preference,\r\nindividually.&amp;nbsp;These types of periodical emails contain new coupon codes,\r\noffers and promotions from the brands a&amp;nbsp;user usually buys and prefer.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 15pt; line-height: 200%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;Association to other\r\nwebsites&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:200%;font-family:\r\n&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;color:#333333&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-top:7.5pt;margin-right:0in;margin-bottom:7.5pt;\r\nmargin-left:0in;line-height:normal;background:#FAFAFA&quot;&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\