(2, 'About US', '&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height:200%&quot;&gt;&lt;span style=&quot;font-family: &amp;quot;Times New Roman&amp;quot;, serif; font-size: 12pt;&quot;&gt;Voucher Wing is one of\r\nthe most leading saving coupon sites which positively influence the buying\r\ndecisions of online shopping. Voucher Wing has connected partners from all over\r\nthe world engaged in buying and selling, all together. It serves more than\r\n50,000 brands internationally. We deal in discount offers, gift cards, coupon\r\ncodes and other promotional offers for the year.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height:200%&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;We ensure to endow you\r\nwith incredible customer care services in order to create a simple and\r\ncomfortable online platform for your shopping. It lets you enjoy amazing\r\ndiscounts for the year, associated to a massive variety of brands. We help all\r\nthese brands to achieve their goals by combining hands with us. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height:200%&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;Our Principles &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height:200%&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;High integrity &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height:200%&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;Greater accessibility &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height:200%&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;Higher reliability &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height:200%&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;Maintaining\r\nconfidentiality &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height:200%&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;Creating relevancy &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height:200%&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:200%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;Offering variety&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', 'about-us', 1, NULL, NULL, NULL, 'About US | Voucherwing', 'About US', 'About US', '2020-01-17 02:49:37', '2020-01-17 02:49:37', NULL),
(5, 'Imprimer', '&lt;p&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Nom de l\'éditeur&lt;/b&gt; : Voucherwing Inc,&lt;/p&gt;&lt;p&gt;&lt;b&gt;Propriétaire d\'entreprise&lt;/b&gt;: James Wilson&lt;/p&gt;&lt;p&gt;&lt;b&gt;Adresse&lt;/b&gt;: 2718 Highland View Drive&lt;/p&gt;&lt;p&gt;Roseville, CA 95678 United States&lt;/p&gt;&lt;p&gt;&lt;b&gt;Téléphone &lt;/b&gt;: +1 916-640-2337&lt;/p&gt;&lt;p&gt;&lt;b&gt;E-mail du propriétaire&lt;/b&gt;: voucherswing@gmail.com&lt;/p&gt;', 'imprimer', 1, NULL, NULL, NULL, 'Imprimer | Voucherwing', 'Imprimer', 'Imprimer', '2020-01-17 07:28:50', '2020-01-17 07:28:50', NULL),
(6, 'Politique de confidentialité', '&lt;p&gt;Voucher Wing souhaite conserver vos informations personnelles en toute sécurité et en toute confidentialité. Nous attendons également la même chose de nos clients. Veuillez lire les politiques de confidentialité suivantes pour comprendre le mécanisme de confidentialité et de confidentialité que Voucher Wing maintient avec les informations que vous nous avez fournies.&lt;/p&gt;&lt;p&gt;La politique de confidentialité est sujette à changement par rapport à la décision de l\'entreprise. Pour rester à jour, continuez de visiter notre page Web officielle.&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Renseignements personnels&lt;/p&gt;&lt;p&gt;Notre équipe extrait uniquement votre adresse e-mail, votre sexe et votre âge lorsque vous vous inscrivez sur notre site Web. L\'utilisateur enregistré ne reçoit qu\'une promotion occasionnelle de son intérêt par courrier électronique. L’adresse électronique n’est ni partagée ni vendue à des agents de commercialisation ou des agences tiers.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Données rassemblées&lt;/p&gt;&lt;p&gt;Les informations collectées, telles que la page visitée par un utilisateur ou l\'accès, et tout ce que ses utilisateurs offrent, sont conservées en toute sécurité avec nous. Dans la mesure où Voucher Wing reconnaît et enregistre les adresses IP lorsqu\'un utilisateur se connecte, il est important que l\'utilisateur sache qu\'il reste sous la confidentialité totale de notre équipe. Lorsqu\'un utilisateur essaie de se connecter sur n\'importe quelle page de Voucher Wing, son adresse IP est enregistrée sur notre serveur, qui sert uniquement à des fins d\'analyse du trafic Web.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Utilisation de cookies&lt;/p&gt;&lt;p&gt;Voucher Wing utilise des cookies uniquement à des fins de conservation des données et pour améliorer encore l\'expérience de l\'utilisateur en mémorisant les mots de passe et en mesurant les activités sur notre site web.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Abonnements et alertes de coupons&lt;/p&gt;&lt;p&gt;Voucher Wing envoie des lettres d\'information et des alertes de coupons uniquement aux utilisateurs enregistrés. La lettre d\'information contient des informations telles que les nouvelles offres, les changements de politique ou toute autre nouvelle importante, car nous souhaitons tenir nos utilisateurs informés. Les alertes de coupon ou de remise peuvent varier d’un utilisateur à l’autre, car nous recueillons les données selon les préférences de l’utilisateur, individuellement. Ces types d’e-mails périodiques contiennent de nouveaux codes de coupon, offres et promotions des marques qu’un utilisateur achète et préfère.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Association à d\'autres sites Web&lt;/p&gt;&lt;p&gt;Nous avons des liens vers d\'autres sites Web et qui ne suivent peut-être pas la même politique que Voucher Wing. Nous sommes responsables de la confidentialité des utilisateurs de Voucher Wing.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Voucherwing Inc,&lt;/b&gt;&lt;/p&gt;&lt;p&gt;2718 Highland View Drive&lt;/p&gt;&lt;p&gt;Roseville, CA 95678 United States&lt;/p&gt;&lt;p&gt;Propriétaire d\'entreprise: James Wilson&lt;/p&gt;&lt;p&gt;Téléphone : +1 916-640-2337&lt;br&gt;&lt;/p&gt;&lt;p&gt;E-mail du propriétaire: voucherswing@gmail.com&lt;/p&gt;', 'politique-de-confidentialité', 1, NULL, NULL, NULL, 'Politique de confidentialité | Voucherwing', 'Politique de confidentialité', 'Politique de confidentialité', '2020-01-17 07:28:52', '2020-01-17 07:28:52', NULL),
(9, 'Conditions d\'utilisation', '&lt;p&gt;&lt;b&gt;Conditions d\'utilisation&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Objet&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Vous vous trouvez sur le site Web de Voucherwing, accessible à l\'adresse suivante: Codepromo.voucherwing.com (ci-après nommé Codepromo.voucherwing.com).&lt;/p&gt;&lt;p&gt;Les présentes &quot;conditions générales d\'utilisation&quot; visent le cadre juridique des modalités de fourniture des services du site Codepromo.voucherwing.com et de leur utilisation par &quot;l\'utilisateur&quot;. Les conditions générales d\'utilisation doivent être acceptées par tout utilisateur souhaitant accéder au site. Ils constituent le contrat entre le site Web et l\'utilisateur. L\'accès au site par l\'utilisateur signifie l\'acceptation de ces termes et conditions d\'utilisation.&lt;br&gt;&lt;/p&gt;&lt;p&gt;Codepromo.voucherwing.com se réserve le droit de modifier unilatéralement les présentes Conditions Générales et autres dispositions légales. Il est donc de la responsabilité de l\'utilisateur de les consulter régulièrement.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Mentions légales&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Le site Web Codepromo.voucherwing.com est produit par Voucherwing, une société à responsabilité limitée dont le siège social est situé au 2718 Highland View Drive, Roseville, CA 95678, États-Unis. Le directeur de la publication est M. James Wilson.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Définitions&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Le but de cette clause est de définir les différentes conditions essentielles du contrat:&lt;/p&gt;&lt;p&gt;Marchand: site de commerce électronique partenaire de Codepromo.voucherwing.com pour lequel nous distribuons des codes promotionnels ou des bons de réduction;&lt;/p&gt;&lt;p&gt;Membre: l\'utilisateur devient membre lorsqu\'il est identifié sur le site;&lt;/p&gt;&lt;p&gt;Site Web: fait référence au site Web Codepromo.voucherwing.com et à tout autre site Web et application.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Accès aux services&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Le site Codepromo.voucherwing.com est accessible gratuitement à tout utilisateur ayant accès à Internet. Le site met en œuvre tous les moyens à sa disposition pour assurer un accès de qualité à ses services. L\'obligation étant de moyen, le site ne s\'engage pas à atteindre ce résultat.&lt;/p&gt;&lt;p&gt;Bien que Codepromo.voucherwing.com mette tout en œuvre pour assurer l\'exactitude et la fiabilité des données de son site web, Codepromo.voucherwing.com ne peut garantir que son site web ou ses services soient exempts d\'erreurs, d\'omissions et de erreurs, bien que des mesures raisonnables soient nécessaires. prises pour maintenir l\'exactitude de ses données présentées sur le site web ou ses services.&lt;/p&gt;&lt;p&gt;Tout événement dû à un cas de force majeure entraînant un dysfonctionnement du réseau ou du serveur ne pouvant engager la responsabilité de Codepromo.voucherwing.com. L’accès aux services du site peut à tout moment faire l\'objet d\'une interruption, d\'une suspension, d\'un changement sans préavis pour maintenance ou pour tout autre cas. L\'utilisateur s\'engage à ne réclamer aucune indemnité à la suite de l\'interruption, de la suspension ou de la modification du présent contrat.&lt;/p&gt;&lt;p&gt;L\'utilisateur a la possibilité de contacter le site Web par courrier électronique à l\'adresse suivante: voucherswing@gmail.com.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Limitation de responsabilité&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Le site Web Codepromo.voucherwing.com et ses services ne sont aucunement responsables des dommages directs, indirects, punitifs, accessoires ou consécutifs résultant de:&lt;/p&gt;&lt;p&gt;Utilisation ou impossibilité d\'utiliser le site Web;&lt;/p&gt;&lt;p&gt;Accès non autorisé ou modification des données de transmission de l\'utilisateur;&lt;/p&gt;&lt;p&gt;Tout autre fait lié aux services, y compris, sans toutefois s\'y limiter, les dommages résultant d\'une perte d\'utilisation, de données ou de profits, est lié, de quelque manière que ce soit, à l\'utilisation ou à la performance du site Web ou de ses services.&lt;/p&gt;&lt;p&gt;L\'utilisateur comprend et accepte que tout matériel et / ou donnée téléchargé ou obtenu via le site web le soit à ses risques et périls.&lt;/p&gt;&lt;p&gt;L\'utilisateur accepte d\'être seul responsable des dommages causés à son ordinateur et / ou des pertes de données résultant du téléchargement de ces éléments.&lt;/p&gt;&lt;p&gt;En aucun cas, Codepromo.voucherwing.com ne garantit l\'exactitude des promotions et des coupons de réduction présentés sur son site web. il est donc conseillé à l\'utilisateur de vérifier son bon fonctionnement avant de valider son achat auprès des marchands.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Liens vers des sites tiers&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Le site Web et ses services peuvent contenir des liens vers des sites tiers. Ces sites ne sont en aucun cas contrôlés par Codepromo.voucherwing.com. Par conséquent, Codepromo.voucherwing.com n\'endosse aucune responsabilité quant au contenu de ces sites. Il appartient à l\'utilisateur de vérifier l\'exactitude de ces informations avant de leur attribuer un crédit.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Propriété intellectuelle&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Tous les éléments du site (structure, contenu, images, photos, logos, textes, etc.) ainsi que tous les outils Web associés (newsletter, page Facebook, compte Pinterest, Twitter, etc.) sont la propriété exclusive du site et sont protégés par la législation française et les traités internationaux (code de la propriété intellectuelle et convention de Berne). Toute reproduction, totale ou partielle d\'un élément du site est strictement interdite. Les contrevenants seront passibles de poursuites.&lt;/p&gt;&lt;p&gt;L\'utilisateur demande l\'autorisation préalable du site pour toute reproduction, publication, copie des différents contenus.&lt;/p&gt;&lt;p&gt;L\'utilisateur s\'engage à utiliser le contenu du site dans un cadre strictement privé. L\'utilisation du contenu à des fins commerciales est strictement interdite.&lt;/p&gt;&lt;p&gt;Tout contenu posté par l\'utilisateur relève de sa seule responsabilité. L\'utilisateur s\'engage à ne pas mettre en ligne des contenus susceptibles d\'affecter les intérêts de tiers. Toute poursuite intentée par un tiers lésé contre le site sera à la charge de l\'utilisateur.&lt;/p&gt;&lt;p&gt;Le contenu de l\'utilisateur peut être à tout moment et pour quelque motif que ce soit supprimé ou modifié par le site. L\'utilisateur ne reçoit aucune justification ni notification avant la suppression ou la modification du contenu de l\'utilisateur.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Données personnelles&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Pour devenir membre du site Web Codepromo.voucherwing.com ou recevoir le bulletin d\'information du site, les informations requises pour l\'inscription sur le site sont obligatoires.&lt;/p&gt;&lt;p&gt;Le site fournit à l\'utilisateur une collecte et un traitement d\'informations personnelles dans le respect de la vie privée, conformément à la loi n ° 78-17 du 6 janvier 1978 relative à l\'informatique, aux fichiers et aux libertés.&lt;/p&gt;&lt;p&gt;En vertu des articles 39 et 40 de la loi du 6 janvier 1978, l\'utilisateur dispose d\'un droit d\'accès, de rectification, de suppression et d\'opposition concernant ses données personnelles en envoyant un courrier électronique à l\'adresse voucherswing@gmail.com. Codepromo.voucherwing.com se réserve le droit de refuser toute inscription ou de supprimer un compte à tout moment sans donner la raison.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Biscuit&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Le site utilise des cookies Codepromo.voucherwing.com. Un cookie est un petit fichier texte stocké dans le navigateur de l\'utilisateur et lui permettant de stocker des informations entre les pages qu\'il visite et son navigateur. Codepromo.voucherwing.com utilise des cookies produits et utilisés par Codepromo.voucherwing.com ainsi que des &quot;cookies externes&quot; générés sur son site web par des tiers. Ils permettent de mémoriser l\'historique des visites de l\'utilisateur sur le site Web, d\'enregistrer les données du client et d\'afficher le contenu approprié en fonction des choix et des visites. Cela aide également Codepromo.voucherwing.com à comprendre le comportement de l\'utilisateur sur son site Web, améliorant ainsi son expérience de navigation. Les cookies ne peuvent pas stocker de texte et sont toujours anonymes et cryptés.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Désactiver et supprimer les cookies&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Tous les navigateurs Internet permettent à l\'utilisateur de limiter le comportement d\'un cookie ou de le désactiver en accédant à la section paramètres ou options de son navigateur. Les étapes de désactivation des cookies sont spécifiques à chaque navigateur, l\'utilisateur peut les trouver dans la section Aide de son navigateur. Grâce au navigateur, l\'utilisateur peut également afficher les cookies qui se trouvent sur son ordinateur et les supprimer à sa guise. Les cookies sont des fichiers texte, l\'utilisateur peut ouvrir et lire leur contenu. Les données contenues sont généralement cryptées avec une clé numérique correspondant à une session Internet. Si l\'utilisateur désactive les cookies, le site Web Codepromo.voucherwing.com n\'est pas en mesure d\'enregistrer ses informations de connexion sur son site. Codepromo.voucherwing.com collabore également avec des partenaires pour créer des cookies tiers, qui sont ensuite utilisés sur d\'autres sites pour diffuser des publicités pertinentes sur les bannières fournies à cette fin. Ces cookies ne contiennent aucune information personnelle, ils n\'identifient pas d\'autres sites et sont basés uniquement sur l\'historique de navigation de l\'utilisateur. Tous les coupons identifiés comme &quot;EXCLUSIFS&quot; ne peuvent être republiés sur aucune autre plate-forme sans le consentement exprès de Codepromo.voucherwing.com. Toutes les offres sont choisies par l\'équipe de Codepromo.voucherwing.com et sont valables à partir de la date de publication. Ces cookies ne contiennent aucune information personnelle, ils n\'identifient pas d\'autres sites et sont basés uniquement sur l\'historique de navigation de l\'utilisateur. Tous les coupons identifiés comme &quot;EXCLUSIVE&quot; ne peuvent être republiés sur aucune autre plate-forme sans le consentement exprès de Codepromo.voucherwing.com. Toutes les offres sont choisies par l\'équipe de Codepromo.voucherwing.com et sont valables à compter de la date de publication. Ces cookies ne contiennent aucune information personnelle, ils n\'identifient pas d\'autres sites et sont basés uniquement sur l\'historique de navigation de l\'utilisateur. Tous les coupons identifiés comme &quot;EXCLUSIFS&quot; ne peuvent être republiés sur aucune autre plate-forme sans le consentement exprès de Codepromo.voucherwing.com. Toutes les offres sont choisies par l\'équipe de Codepromo.voucherwing.com et sont valables à partir de la date de publication.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Loi applicable et juridiction compétente&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Toutes ces conditions générales d\'utilisation sont soumises à la loi française: les tribunaux français seront les seules autorités compétentes en cas de litige.&lt;/p&gt;', 'conditions-d-utilisation', 1, NULL, NULL, NULL, 'Conditions d\'utilisation | Voucherwing', 'Conditions d\'utilisation', 'Conditions d\'utilisation', '2020-01-17 07:28:53', '2020-01-17 07:28:53', NULL),
(10, 'À propos de nous', '&lt;p&gt;Voucher Wing est l\'un des principaux sites de coupons d\'épargne qui influence positivement les décisions d\'achat des achats en ligne. Voucher Wing a des partenaires connectés du monde entier engagés dans l\'achat et la vente, tous ensemble. Il sert plus de 50 000 marques à l\'échelle internationale. Nous traitons des offres de rabais, des cartes-cadeaux, des codes de bon de réduction et d\'autres offres promotionnelles pour l\'année.&lt;/p&gt;&lt;p&gt;Nous nous assurons de vous doter de services d\'assistance à la clientèle incroyables afin de créer une plate-forme en ligne simple et confortable pour vos achats. Il vous permet de bénéficier de remises exceptionnelles pour l’année, associées à une grande variété de marques. Nous aidons toutes ces marques à atteindre leurs objectifs en combinant leurs mains avec nous.&lt;/p&gt;&lt;p&gt;Nos principes&lt;/p&gt;&lt;p&gt;Haute intégrité&lt;/p&gt;&lt;p&gt;Plus grande accessibilité&lt;/p&gt;&lt;p&gt;Plus grande fiabilité&lt;/p&gt;&lt;p&gt;Maintenir la confidentialité&lt;/p&gt;&lt;p&gt;Créer de la pertinence&lt;/p&gt;&lt;p&gt;Offrant la variété&lt;/p&gt;', 'a-propos-de-nous', 1, NULL, NULL, NULL, 'À propos de nous | Voucherwing', 'À propos de nous', 'À propos de nous', '2020-01-17 07:28:54', '2020-01-17 07:28:54', NULL),
(3, 'Über uns', '&lt;p&gt;Voucher Wing ist eine der führenden Sites für Spargutscheine, die die Kaufentscheidungen beim Online-Einkauf positiv beeinflussen. Voucher Wing hat Partner aus der ganzen Welt zusammengebracht, die gemeinsam kaufen und verkaufen. Es bedient mehr als 50.000 Marken international. Wir handeln mit Rabattangeboten, Geschenkkarten, Gutscheincodes und anderen Sonderangeboten für das Jahr.&lt;/p&gt;&lt;p&gt;Wir stellen sicher, dass Sie einen unglaublichen Kundenservice erhalten, um eine einfache und komfortable Online-Plattform für Ihren Einkauf zu schaffen. Mit dieser App können Sie das ganze Jahr über tolle Preisnachlässe für eine Vielzahl von Marken genießen. Wir helfen all diesen Marken, ihre Ziele zu erreichen, indem wir uns zusammenschließen.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Unsere Prinzipien&lt;/p&gt;&lt;p&gt;Hohe Integrität&lt;/p&gt;&lt;p&gt;Bessere Zugänglichkeit&lt;/p&gt;&lt;p&gt;Höhere Zuverlässigkeit&lt;/p&gt;&lt;p&gt;Vertraulichkeit wahren&lt;/p&gt;&lt;p&gt;Relevanz schaffen&lt;/p&gt;&lt;p&gt;Vielfalt bieten&lt;/p&gt;', 'uber-uns', 1, NULL, NULL, NULL, 'Über uns | Voucherwing', 'Über uns', 'Über uns', '2020-01-20 04:44:04', '2020-01-20 04:44:04', NULL),
(4, 'Impressum', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Name des Herausgebers &lt;/b&gt;: Voucherwing Inc,&lt;/p&gt;&lt;p&gt;&lt;b&gt;Geschäftsinhaber&lt;/b&gt;: James Wilson&lt;/p&gt;&lt;p&gt;&lt;b&gt;Adresse&lt;/b&gt;: 2718 Highland View Drive&lt;/p&gt;&lt;p&gt;Roseville, CA 95678 United States&lt;/p&gt;&lt;p&gt;&lt;b&gt;Telefon &lt;/b&gt;: +1 916-640-2337&lt;/p&gt;&lt;p&gt;&lt;b&gt;E-Mail des Eigentümers&lt;/b&gt;: voucherswing@gmail.com&lt;/p&gt;', 'impressum', 1, NULL, NULL, NULL, 'Impressum | Voucherwing', 'Impressum', 'Impressum', '2020-01-20 04:44:04', '2020-01-20 04:44:04', NULL),
(7, 'Datenschutz', '&lt;p&gt;Voucher Wing ist bestrebt, Ihre persönlichen Daten sicher und vertraulich zu behandeln. Das erwarten wir auch von unseren Kunden. Bitte lesen Sie die folgenden Datenschutzrichtlinien, um den Mechanismus der Vertraulichkeit und des Datenschutzes zu verstehen, den Voucher Wing mit Ihren uns zur Verfügung gestellten Informationen pflegt.&lt;/p&gt;&lt;p&gt;Die Datenschutzbestimmungen unterliegen Änderungen in Bezug auf die Entscheidung des Unternehmens. Um auf dem Laufenden zu bleiben, besuchen Sie unsere offizielle Webseite.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Persönliche Informationen&lt;/p&gt;&lt;p&gt;Unser Team extrahiert Ihre E-Mail-Adresse, Ihr Geschlecht und Ihr Alter nur, wenn Sie sich auf unserer Website anmelden. Der registrierte Benutzer wird nur gelegentlich per E-Mail über sein Interesse informiert. Die E-Mail-Adresse wird nicht an Drittanbieter oder Agenturen weitergegeben oder verkauft.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Gesammelte Daten&lt;/p&gt;&lt;p&gt;Die gesammelten Informationen, z. B. welche Seite ein Benutzer am häufigsten besucht, oder der Zugriff und alles, was er freiwillig macht, werden sicher bei uns aufbewahrt. Da Voucher Wing IP-Adressen erkennt und speichert, wenn sich ein Benutzer anmeldet, ist es wichtig, dass der Benutzer weiß, dass diese von unserem Team streng vertraulich behandelt werden. Wenn ein Benutzer versucht, sich auf einer Voucher Wing-Seite anzumelden, wird seine IP auf unserem Server gespeichert, der nur zur Analyse des Webverkehrs verwendet wird.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Verwendung von Cookies&lt;/p&gt;&lt;p&gt;Voucher Wing verwendet Cookies nur, um Aufzeichnungen zu führen und die Benutzererfahrung durch Speichern der Passwörter und Messen der Aktivitäten auf unserer Website zu verbessern.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Abonnements und Gutscheinbenachrichtigungen&lt;/p&gt;&lt;p&gt;Voucher Wing sendet Newsletter und Gutscheinbenachrichtigungen nur an registrierte Benutzer. Der Newsletter enthält Informationen wie neue Angebote, Änderungen der Richtlinien oder andere wichtige Neuigkeiten, damit wir unsere Benutzer auf dem Laufenden halten können. Coupon- oder Rabattbenachrichtigungen können von Benutzer zu Benutzer unterschiedlich sein, da wir die Daten nach Wunsch des Benutzers einzeln erfassen. Diese Art von regelmäßigen E-Mails enthält neue Gutscheincodes, Angebote und Werbeaktionen der Marken, die ein Benutzer normalerweise kauft und bevorzugt.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Verknüpfung mit anderen Websites&lt;/p&gt;&lt;p&gt;Wir haben Links zu anderen Websites, die möglicherweise nicht den Richtlinien von Voucher Wing entsprechen. Wir sind dafür verantwortlich, die Privatsphäre der Voucher Wing-Benutzer zu wahren.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 28px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Voucherwing Inc,&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 28px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2718 Highland View Drive&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 28px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Roseville, CA 95678 United States&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 28px;