(8, 'Nutzungsbedingungen', '&lt;p&gt;&lt;b&gt;NUTZUNGSBEDINGUNGEN&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Bitte lesen Sie die folgenden Nutzungsbedingungen sorgfältig durch, da diese für die Nutzung von gutscheine.voucherwing.com gelten, insbesondere wenn Sie einen Gutscheincode oder ein bestimmtes Produktangebot verwenden (sogenanntes Angebot).&lt;/p&gt;&lt;p&gt;&lt;b&gt;DEFINITIONEN&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Händler: Dies sind alle Verkäufer, die die Website gutscheine.voucherwing.com nutzen, um Waren anzubieten.&lt;/p&gt;&lt;p&gt;Website: Dies bedeutet immer gutscheine.voucherwing.com bzw. Apps und Unterseiten.&lt;/p&gt;&lt;p&gt;Benutzer: Dies bedeutet, wer die Website oder deren Angebote nutzt.&lt;/p&gt;&lt;p&gt;Service: Dies bedeutet die Nutzung der Website und ihrer Funktionen.&lt;/p&gt;&lt;p&gt;&lt;b&gt;GENERELL&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Die Nutzung dieser Website ist ausschließlich für Nutzer aus Deutschland bestimmt. Neben diesen Nutzungsbedingungen gelten für die Angebote der Händler (Gutscheine oder Angebote) die Vertragsbedingungen des jeweiligen Händlers, die der Nutzer bei Vertragsabschluss mit dem Händler ausdrücklich anerkennt.&lt;/p&gt;&lt;p&gt;In Bezug auf die Angebote der Händler auf unserer Website beschränken sich unsere Dienstleistungen auf die Zuordnung von Nutzern und Händlern zu einem Händlercoupon oder -geschäft.&lt;br&gt;&lt;/p&gt;&lt;p&gt;Bei den Leistungen der Händler treten wir ausschließlich als Vermittler und nicht als Vertragspartner des Nutzers auf. Infolgedessen sind wir, unsere Mitarbeiter und Mitarbeiter in keiner Weise für die vertragliche Erfüllung solcher Verträge verantwortlich. Die Erfüllung dieser Verträge liegt in der alleinigen Verantwortung der Händler und Nutzer.&lt;br&gt;&lt;/p&gt;&lt;p&gt;Die Angebote auf der Website sind nur für den nicht kommerziellen und privaten Gebrauch bestimmt. Eine von diesen Nutzungsbedingungen abweichende oder gegen diese Nutzungsbedingungen verstoßende Nutzung unserer Dienste ist nicht gestattet. Insbesondere liegt eine missbräuchliche Verwendung vor, wenn Sie vervielfältigen, kopieren, gegen Entgelt Dritten zugänglich machen oder unentgeltlich Änderungen vornehmen oder in sonstiger Weise in unseren Service eingreifen. Verstoßen Sie dagegen, können wir Sie vorübergehend oder dauerhaft von der Nutzung des Dienstes ausschließen und ggf. Schadensersatzansprüche gegen Sie geltend machen.&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;BEREITSTELLUNG UNSERER DIENSTLEISTUNGEN&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Die Nutzung der Website und ihrer Funktionen (nachfolgend unser Service oder der Service) ist für Sie kostenfrei. Wir arbeiten ständig an Innovationen, um den Service noch besser zu machen - zum Beispiel durch Hinzufügen oder Entfernen von Features oder Features.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Wir können die Form und die Art unserer Dienstleistungen jederzeit und ohne vorherige Ankündigung ändern. Dies kann die Einstellung einzelner Dienste oder des gesamten Angebots umfassen. Natürlich können Sie den Dienst auch jederzeit kündigen. Hierfür ist keine Kündigung oder Nachricht an uns erforderlich. Es reicht aus, dass Sie den Dienst nicht mehr nutzen.&lt;/p&gt;&lt;p&gt;&lt;b&gt;ES IST VERBOTEN:&lt;/b&gt;&lt;/p&gt;&lt;p&gt;• Um den Inhalt dieser Website zu reproduzieren. Vor allem auf anderen Websites.&lt;/p&gt;&lt;p&gt;• Anstößige oder unangemessene Inhalte hochladen oder verbreiten.&lt;/p&gt;&lt;p&gt;• Laden Sie Inhalte hoch, für die Sie keine Rechte haben.&lt;/p&gt;&lt;p&gt;• Software oder Programme. Insbesondere Programme oder Software, die der Website Schaden zufügen könnten.&lt;/p&gt;&lt;p&gt;• Teilen Sie Inhalte von anderen Benutzern ohne deren Erlaubnis.&lt;/p&gt;&lt;p&gt;• Gesetze des Landes Deutschland nicht beachten.&lt;/p&gt;&lt;p&gt;• Missachten Sie die in diesen Nutzungsbedingungen aufgeführten Punkte.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;NUTZUNG DIESER SEITE UND IHRER ANGEBOTE&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Wir garantieren zu keinem Zeitpunkt die Richtigkeit der Angebote und die fehlerfreie Nutzung unseres Angebots. Selbstverständlich bemühen wir uns, die Website fehlerfrei zu halten und eventuelle Fehler auszuschließen.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Wir garantieren keinen einfachen Zugang zu unserer Website. Der Zugang zu unserer Website kann jederzeit unterbrochen werden.&lt;/p&gt;&lt;p&gt;Wir behalten uns das Recht vor, Angebote (zB Gutscheine und Angebote) ohne vorherige Ankündigung zu löschen.&lt;/p&gt;&lt;p&gt;&lt;b&gt;VERRIEGELUNG EINES BENUTZERS&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Wir behalten uns das Recht vor, Benutzer ohne Angabe von Gründen von der Nutzung unserer Website auszuschließen.&lt;/p&gt;&lt;p&gt;&lt;b&gt;HAFTUNGSBESCHRÄNKUNG&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Wir übernehmen keine Haftung dafür, dass die Angebote der Händler richtig dargestellt werden oder noch vorhanden sind, da wir hierauf keinen Einfluss haben. Benutzer sollten sich immer wieder mit dem Händler in Verbindung setzen, wenn das Angebot wirklich besteht. Nach den gesetzlichen Bestimmungen der §§ 8 bis 10 TMG sind wir als Diensteanbieter jedoch nicht verpflichtet, übermittelte oder veröffentlichte fremde Informationen zu überwachen oder nach Umständen zu forschen, die auf eine rechtswidrige Tätigkeit hinweisen auf rechtswidrige Handlungen hinweisen.&lt;/p&gt;&lt;p&gt;&lt;b&gt;LINKS ZU ANDEREN WEBSITES&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Diese Website kann Links zu anderen Websites enthalten. Da die Websites nicht von uns betrieben werden, können wir keine Verantwortung oder Haftung für den Inhalt dieser Websites übernehmen. Wir bieten diese Links ausschließlich als Kundenservice an und machen uns diese nicht zu eigen.&lt;/p&gt;&lt;p&gt;&lt;b&gt;GEISTIGES EIGENTUM&lt;/b&gt;&lt;/p&gt;&lt;p&gt;Die im Rahmen des Angebots veröffentlichten Inhalte (insbesondere Texte und Bilder) sind urheberrechtlich geschützt. Die Vervielfältigung oder sonstige Verwendung oder Verwertung von urheberrechtlich geschützten Inhalten ist ohne